import { ChatEngine } from 'react-chat-engine';

import ChatFeed from './components/ChatFeed.jsx';

import './App.css';

const App = () => {
    return (
        <ChatEngine 
            height="100vh"
            projectID="1bf81ce9-62ca-4532-a837-de087b3b1926"
            userName="SavannaJSM"
            userSecret="secret"
            renderChatFeed={(chatAppProps) => <ChatFeed {...chatAppProps} />}
        />
    )
}

export default App;
